import { Component, Input } from '@angular/core';
import { Button } from 'primeng/button';
import { StoryObj } from '@storybook/angular';

const template = `
<div class="bg-surface-ground p-4">
  <p-button
    [label]="label"
    [disabled]="disabled"
    [loading]="loading"
    [size]="size"
    [rounded]="rounded"
    [outlined]="outlined"
    [text]="text"
    [icon]="icon"
    [iconPos]="iconPos"
    [badge]="badge"
    [severity]="severity"
  >
  </p-button>
</div>
`;
const styles = ``;

@Component({
  selector: 'app-button-base',
  standalone: true,
  imports: [Button],
  template,
  styles
})
export class ButtonBaseComponent {
  @Input() label = '';
  @Input() disabled = false;
  @Input() loading = false;
  @Input() size: 'small' | 'large' | null = null;
  @Input() rounded = false;
  @Input() outlined = false;
  @Input() text = false;
  @Input() icon: string = '';
  @Input() iconPos: 'left' | 'right' | null = null;
  @Input() badge: string = '';
  @Input() severity: 'success' | 'info' | 'warn' | 'primary' | 'help' | 'danger' | null = null;
}

